import logo from './logo.svg';
import './App.css';
import Main from './Main';
import { Route, Routes } from 'react-router-dom';
import Message from './Message';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Main />} />
        <Route path="/message" element={<Message />}/>
      </Routes>
    </div>
  );
}

export default App;
